import {FaShoppingCart} from "react-icons/fa"
import { FaCode } from "react-icons/fa";
import {NavLink} from "react-router-dom"

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <NavLink to='/' >
          <div>
            <FaCode/>
          </div>
        </NavLink>
        <div>
          <NavLink to>
            <p>Home</p>
          </NavLink>
          <FaShoppingCart/>
          
        </div>
      </div>
    </div>
  );
};

export default Navbar;
